import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
function Scroll(){
    return(<div className="mainCont">
        <h3>დაატრიალე რჩეული სლოტები:</h3>
        <p>*სპინზე ფსონის მინ. რაოდენობა შეზღუდული არ არის.</p>
        <div className='slider'></div>
    </div>)
}
export default Scroll
